  const marginLeft = 40;

  const loss_max = d3.max(points, (p) => d3.max(p, (d) => d[1]));

    .scaleLinear()
    .domain([loss_min, loss_max])
    .range([height - marginBottom, marginTop]);

  const line = d3
    .line()
    .x((d) => xScale(d[0]))
    .y((d) => yScale(d[1]));

    .selectAll(".line")
    .data(points)
    .join("path")
    .attr("class", "line")
    .attr("d", (d) => line(d))
    .attr("stroke", "rgba(78,103,207,1)")
    .attr("fill", "steelblue")
    .attr("opacity", 0.5)
